webpackJsonp([0x8e77c90589a8],{3175:function(e,n){e.exports={data:{challengeNode:{title:"Problem 382: Generating polygons",description:["A polygon is a flat shape consisting of straight line segments that are joined to form a closed chain or circuit. A polygon consists of at least three sides and does not self-intersect.","","","","A set S of positive numbers is said to generate a polygon P if: no two sides of P are the same length,"," the length of every side of P is in S, and"," S contains no other value.","","For example:","The set {3, 4, 5} generates a polygon with sides 3, 4, and 5 (a triangle).","The set {6, 9, 11, 24} generates a polygon with sides 6, 9, 11, and 24 (a quadrilateral).","The sets {1, 2, 3} and {2, 3, 4, 9} do not generate any polygon at all.","","","Consider the sequence s, defined as follows:s1 = 1, s2 = 2, s3 = 3","sn = sn-1 + sn-3 for n > 3.","","Let Un be the set {s1, s2, ..., sn}. For example, U10 = {1, 2, 3, 4, 6, 9, 13, 19, 28, 41}.","Let f(n) be the number of subsets of Un which generate at least one polygon.","For example, f(5) = 7, f(10) = 501 and f(25) = 18635853.","","","","Find the last 9 digits of f(1018)."],challengeType:5,fields:{slug:"/coding-interview-prep/project-euler/problem-382-generating-polygons",blockName:"Project Euler",tests:[{text:"<code>euler382()</code> should return 697003956.",testString:"assert.strictEqual(euler382(), 697003956, '<code>euler382()</code> should return 697003956.');"}]},required:[],files:{indexhtml:null,indexjs:{key:"indexjs",ext:"js",name:"index",contents:"function euler382() {\n  // Good luck!\n  return true;\n}\n\neuler382();",head:"",tail:""},indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/coding-interview-prep/project-euler/problem-383-divisibility-comparison-between-factorials",id:"5900f4eb1000cf542c50fffd"},slug:"/coding-interview-prep/project-euler/problem-382-generating-polygons"}}}});
